import Styles from './acoesCard.module.css'

function AcoesCards({acoes}){
    return(
        <div className={Styles.divDosCards}>
            {acoes && acoes.map(acao=>(
                <div className={Styles.cardAcao}>
                    <button className={Styles}>lopes</button>
                    <h3>{acao.nomeAcao}</h3>
                    <p><span>Valor:</span>{acao.valor}</p>
                    <p><span>Data:</span>{acao.dataDaAcao}</p>
                    <p><span>Tipo:</span>{acao.tipo}</p>
                </div>
            )
            )}
        </div>
    )
}

export default AcoesCards
